import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Tone from "tone";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          {new Tone.GrainPlayer("https://www.youtube.com/watch?v=8dXlg_zVK38")}
        </div>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
